import React from "react";
import logo from "../logo.svg";

function Header() {
  return (
    <header>
      <a href="/">
        <img src={logo} alt="Logo" className="logo" />
      </a>
      <div className="header-right">
        <a href="/" className="header-a">
          Products
        </a>
        <a href="/" className="header-a">
          Pricing
        </a>
        <a href="/" className="header-a">
          Sign In
        </a>
      </div>
    </header>
  );
}
// Add CSS styles for the header
const styles = {
  header: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    padding: "0 30px",
    backgroundColor: "#232F3E",
    color: "#FFFFFF",
  },
  logo: {
    width: "130px",
  },
  "header-right": {
    display: "flex",
    alignItems: "center",
  },
  "header-a": {
    marginLeft: "30px",
    color: "#FFFFFF",
    textDecoration: "none",
    fontWeight: "bold",
  },
};

export default Header;
